import React from 'react';
import Header from './component/navbar';
import HomePage from './component/homepage';
import Profile from './component/profile';
import Apply from './component/apply';

const App = () => {
  const handleLinkClick = (url) => {
    window.open(url, '_blank');
  };

  return (
    <div className="App">
      <Header />
      <div>
        <button onClick={() => handleLinkClick('/homepage')}>Home</button>
        <button onClick={() => handleLinkClick('/profile')}>Profile</button>
        <button onClick={() => handleLinkClick('https://www.w3schools.com/')}>Course</button>
        <button onClick={() => handleLinkClick('/apply')}>Apply</button>
      </div>
      <div>
        {window.location.pathname === '/homepage' && <HomePage />}
        {window.location.pathname === '/profile' && <Profile />}
        {window.location.pathname === '/apply' && <Apply />}
      </div>
    </div>
  );
};

export default App;
